import React, { Component } from 'react'

export default class Footer extends Component {
    render() {
        return (
                <div class="text-center text-lg-start" style= {{backgroundColor: rgba(0, 0, 0, 0.2)}}>
                    

                    <div class="text-center p-3 bg-dark text-white">
                        <i class="far fa-copyright"></i>
                        <a class="text-white" href="https://nerdgearz.com/">NerdGearz.com</a>
                    </div>
            </div>
        )
    }
}
